import "./App.css";
import Header from "./elements/common/header/Header";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import About from "./elements/about/About";
import CourseHome from "./elements/allcourses/CourseHome";
import Team from "./elements/team/Team";
import Pricing from "./elements/pricing/Pricing";
import Blog from "./elements/blog/Blog";
import Contact from "./elements/contact/Contact";
import Footer from "./elements/common/footer/Footer";
import Home from "./elements/home/Home";
import { BrowserRouter } from "react-router-dom/cjs/react-router-dom.min";

function App() {
  return (
    <>
      <BrowserRouter>
        <Header />
        <Router>
          <Route path="/" element={<Home />} />
          <Route path="/about" element={<About />} />
          <Route path="/courses" element={CourseHome} />
          <Route path="/team" element={Team} />
          <Route path="/pricing" element={Pricing} />
          <Route path="/journal" element={Blog} />
          <Route path="/contact" element={Contact} />
        </Router>
        <Footer />
      </BrowserRouter>
    </>
  );
}

export default App;
